import React from "react";

import TaskList from "../components/TaskList";

const AllTasks = () => {
    return <h2>Create Task</h2>
    const TASKS = [
        {
          id : 't1', 
             creator : 'Ananya Gupta', 
             tasks : {
                 task1: 'Study JavaScript',
                 task2: 'Go to Gym'
    }
    }
    ];
    // return <TaskList items = {TASKS} />;
};

export default AllTasks;
